  const [isBeginning, setIsBeginning] = useState(true);
  const begin = () =>{
    setIsBeginning(false);
  };

  return (
    <div>
      <h1>Word Quest!!</h1>
      {isBeginning && (<Intro begin={()=>begin()}/> )}
    </div>
  );
}

export default App;
